    // ========= 2) Knowledge base defined in JS =========
    const KB_RAW = [
      "The Eiffel Tower is located in Paris.",
      "ONNX enables efficient cross-platform AI inference.",
      "MiniLM is a lightweight transformer often used for text embeddings.",
      "Semantic search relies on vector similarity, commonly cosine over normalized embeddings."
    ];
    const KB = []; // { text, embedding }

    // ========= 3) Tokenizer implementation (no placeholders) =========
    function normalize(text) {
      const stripped = text.normalize("NFKD").replace(/[\u0300-\u036f]/g, "");
      return TOKENIZER_CONFIG.doLowerCase ? stripped.toLowerCase() : stripped;
    }

    function basicSplit(text) {
      // Split on word boundaries and keep punctuation as separate tokens.
      return normalize(text).split(/\b|(?=\W)/).filter(t => t.trim().length);
    }

    function wordpiece(token) {
      const unkId = VOCAB[TOKENIZER_CONFIG.unkToken];
      const maxChars = 100;
      if (!token || token.length > maxChars) return [unkId];

      let start = 0;
      const out = [];
      while (start < token.length) {
        let end = token.length;
        let sub = null;
        while (start < end) {
          let piece = token.slice(start, end);
          if (start > 0) piece = TOKENIZER_CONFIG.wordpiecePrefix + piece;
          if (piece in VOCAB) { sub = piece; break; }
          end--;
        }
        if (!sub) return [unkId];
        out.push(VOCAB[sub]);
        start = end;
      }
      return out;
    }

    function tokenize(text) {
      if (!VOCAB) throw new Error("VOCAB not loaded.");
      assertSpecialTokens();

      const cls = VOCAB[TOKENIZER_CONFIG.clsToken];
      const sep = VOCAB[TOKENIZER_CONFIG.sepToken];
      const pad = VOCAB[TOKENIZER_CONFIG.padToken];

      const pieces = basicSplit(text).flatMap(word => wordpiece(word));

      let ids = [cls, ...pieces.slice(0, TOKENIZER_CONFIG.maxLen - 2), sep];
      const attn = Array(ids.length).fill(1);

      while (ids.length < TOKENIZER_CONFIG.maxLen) {
        ids.push(pad);
        attn.push(0);
      }
      return { ids, attn };
    }

    // ========= 4) Model inference and embedding =========
    let session;

    function toIntTensor(arr) {
      // Prefer int64, fall back to int32 if needed
      try {
        return new ort.Tensor("int64", BigInt64Array.from(arr.map(BigInt)), [1, arr.length]);
      } catch {
        return new ort.Tensor("int32", Int32Array.from(arr), [1, arr.length]);
      }
    }

    async function embedWithMiniLM(text) {
      if (!session) throw new Error("ONNX session not initialized");
      const { ids, attn } = tokenize(text);
      const feeds = {};
      const idsT = toIntTensor(ids);
      const attnT = toIntTensor(attn);
      const tokenType = toIntTensor(new Array(ids.length).fill(0));

      // Feed based on model's expected inputs
      for (const name of session.inputNames) {
        if (name === "input_ids") feeds[name] = idsT;
        else if (name === "attention_mask") feeds[name] = attnT;
        else if (name === "token_type_ids") feeds[name] = tokenType;
      }

      const out = await session.run(feeds);
      // Prefer 'last_hidden_state' if present, otherwise first output
      const outName = session.outputNames.includes("last_hidden_state")
        ? "last_hidden_state"
        : session.outputNames[0];

      const tensor = out[outName];
      const data = tensor.data;     // Float32Array
      const dims = tensor.dims;     // [1, seq, dim]
      const seq = dims[1];
      const dim = dims[2];

      // Mean pooling over non-padded tokens
      const sum = new Float32Array(dim);
      let count = 0;
      for (let i = 0; i < seq; i++) {
        if (i >= attn.length || attn[i] === 0) continue;
        const base = i * dim;
        for (let j = 0; j < dim; j++) sum[j] += data[base + j];
        count++;
      }
      const denom = Math.max(count, 1e-6);
      for (let j = 0; j < dim; j++) sum[j] /= denom;

      // L2 normalize
      let norm = 0;
      for (let j = 0; j < dim; j++) norm += sum[j] * sum[j];
      norm = Math.sqrt(norm) || 1;
      for (let j = 0; j < dim; j++) sum[j] /= norm;

      return Array.from(sum);
    }

    function cosine(a, b) {
      let dot = 0;
      for (let i = 0; i < a.length; i++) dot += a[i] * b[i];
      return dot; // embeddings are normalized -> cosine == dot
    }

    // ========= 5) App bootstrap =========
    const statusEl = document.getElementById("status");
    const kbEl = document.getElementById("kbPreview");
    const resultsEl = document.getElementById("results");
    const searchBtn = document.getElementById("searchBtn");

    async function bootstrap() {
      try {
        statusEl.textContent = "Loading modelâ€¦";
        session = await ort.InferenceSession.create('/MiniLM.onnx');

        statusEl.textContent = "Embedding KBâ€¦";
        KB.length = 0;
        for (const text of KB_RAW) {
          const emb = await embedWithMiniLM(text);
          KB.push({ text, embedding: emb });
        }
        kbEl.textContent = KB.map((e, i) => `${i + 1}. ${e.text}`).join("\n");
        statusEl.textContent = "Ready.";
      } catch (e) {
        console.error(e);
        statusEl.textContent = "Error: " + e.message;
      }
    }

    async function searchKB() {
      const q = document.getElementById("queryInput").value.trim();
      if (!q) { resultsEl.textContent = "Enter a query."; return; }
      if (KB.length === 0) { resultsEl.textContent = "KB is empty or not embedded yet."; return; }

      const qEmb = await embedWithMiniLM(q);
      const scores = KB.map((e, i) => ({ idx: i, score: cosine(qEmb, e.embedding), text: e.text }));
      scores.sort((a, b) => b.score - a.score);

      resultsEl.textContent = scores.slice(0, 5)
        .map(s => `${(s.score * 100).toFixed(2)}% match: ${s.text}`)
        .join("\n");
    }

    searchBtn.addEventListener("click", searchKB);
    bootstrap();
  </script>
</body>
</html>
